import closeBtn from "../images/close.svg";
import successLogo from "../images/success-logo.svg";
import errorLogo from "../images/error-logo.svg";

function InfoTooltip(props) {
    return (
        <div className={`popup `}>
            <div className="popup__container">
                <button
                    type="button"
                    className="popup__close-btn"
                    onClick={props.onClose}
                >
                    <img className="popup__close-image" src={closeBtn} alt="закрыть" />
                </button>
                <div className="popup__tulpip">
                    <img className="popup__tultip-image" alt="статус" src={successLogo}></img>
                    <h2 className="popup__tultip-title">Вы успешно зарегистрировались!</h2>
                </div>
            </div>
        </div>
    )
}

export default InfoTooltip;
